(1, '2016-06-18 00:00:00', '2016-06-18 00:00:00', 'DNAmarketingltd', 34, '', 'http://dnamarketingltd.com', '34', 'DNA Marketing LTD was established in order to provide marketing solutions to relocation companies in the US.\r\nOur wide network of Agents, Moving companies, warehouses and employees allow us to provide a wide range of services all over the US 24/7 in a cost effective way.\r\n\r\nWe select each moving company very carefully to ensure all companies operate at the highest level of service, professionalism, and accountability. Each company is independently owned and run, with all of the appropriate licensing. With dedication to providing the customer with a trustworthy and excellent moving experience, we offer a high-end moving service to each customer—and we constantly deliver.', '', 'Hashmonaim 113, Tel-Aviv', '', '077-456-0089', '03-9008639', '', '1', 47, 0, '', NULL, ''),
(4, '2016-06-18 00:00:00', '2016-06-18 00:00:00', 'Ewave', 64, '', 'http://ewave.co.il', '0', '', 'eWave היא ספקית מובילה של פתרונות תוכנה ואינטגרציה, המתמחה בפיתוח ובהטמעת מערכות eBusiness שמטרתן יצירת ערך עסקי אמיתי ללקוח. eWave מספקת שירותים כוללים ליישום אסטרטגיה דיגיטאלית, החל ממתן ייעוץ לגיבוש האסטרטגיה ועד למימושה באמצעות פלטפורמות, כלים ויישומים משלימים. מחלקת הייעוץ האסטרטגי וחווית המשתמש (UX) מייעצת ללקוחותינו כיצד לרתום את המדיה הדיגיטאלית לטובת יעדיהם העסקיים, מסייעת להבין את צרכי המשתמשים ומתרגמת את האסטרטגיה למתווה פעולה מעשי. חטיבות הפיתוח מיישמות את האסטרטגיה, מאפיינות ומפתחות מערכות בארכיטקטורות SOA ו-BPM, תוך שימוש בטכנולוגיות Java, .NET ו-PHP. החברה היא שותפה עסקית של יצרני התוכנה המובילים בעולם: Microsoft, Oracle ו-IBM.', '', 'סניף רעננה - רח\' ירושלים 34  (בניין גמלא B, קומה 2)', '09-9543040', '09-9545070', '', '1', 31, 0, '', NULL, ''),
(5, '2016-06-18 00:00:00', '2016-06-18 00:00:00', 'Taptica', 34, '', 'http://www.taptica.com', '51-200', 'Taptica is a global end-to-end mobile advertising platform that helps the world’s top brands reach their most valuable users with the widest range of traffic sources available today, including social. Our proprietary technology leverages big data, and combined with state-of-the-art machine learning, enables quality media targeting at scale. Taptica creates a single arena in which brands can scale and engage more relevantly with mobile audiences, staying ahead of the competition. We work with more than 450 advertisers including Amazon, Disney, Facebook, Twitter, OpenTable, Expedia, Lyft and Zynga. Taptica is headquartered in Israel with offices in San Francisco, New York, Boston and Beijing. Taptica Ltd. is traded on the London Stock Exchange (AIM: TAP).', '', 'HaHashmonaim Street 21, Tel Aviv-Yafo, Israel', '', '', '', '', '1', 47, 0, '', NULL, '2011'),
(6, '2016-06-24 00:00:00', '2016-06-24 00:00:00', 'Investing.com', -10, '', 'http://www.investing.com', '', 'Investing.com the world\'s fastest growing financial portal, currently ranking in the industry\'s top 5 sites globally, is looking for a full-time Financial Content Writer to develop and create daily, strategic commentary about the U.S. and global financial markets with a regular focus on equities.', '', '', '', '', '', '', '1', 33, 0, '', NULL, ''),
(7, '2016-06-24 00:00:00', '2016-06-24 00:00:00', 'Infinity Labs', 66, '', 'http://infinitylabs.co.il/', '51-200', 'Infinity Labs R&D is a Knowledge Center specializing in Software R&D, specifically of software technologies related to Pervasive Computing. \r\nAside from developing its own Intellectual Property (IP), Infinity Labs R&D shares its knowledge and expertise through services such as training, coaching, consulting, research and development. Whether it be parallel computing, open source, cyber-security, mobile, distributed systems, event-driven architectures, real-time/embedded, web,or cloud computing Infinity Labs R&D’s experts are there to ensure your success. \r\nInfinity Labs R&D’s technical R&D team consists of leaders in their respective fields. With an eye towards tomorrow’s technology, as well as solid real-world experience to back them up, Infinity Labs R&D researchers and consultants quickly provide high quality technical yet practical solutions. \r\nUtilizing the proprietary C.R.E.A.T.E. Learning Spiral, Infinity Labs R&D  has developed a unique and revolutionary 28 week training program for transforming Computer Science and STEM graduates into top-tier software developers who are as capable, if not better, than developers with 3+ years experience.', 'Infinity Labs R&D מבית Matrix היא חברת מחקר ופיתוח המפעילה מאז 2014 תכנית הכשרה מהפכנית בתחום ההייטק. התכנית מאפשרת לכם, בוגרים מצטיינים בתחומי מדעי המחשב, המדעים המדויקים, בוגרי הנדסה ופקולטות נוספות, להשתלב בהצלחה בתפקידי הנדסה ופיתוח משמעותיים בשוק ההייטק, כשבידיכם יתרון משמעותי בשוק העבודה התחרותי. מידי שנה, אנו מגייסים מתוך אלפי מועמדים כ- 250 בוגרי מדעי המחשב ומדעים מדויקים מצטיינים ללא ניסיון לתכנית. Infinity Labs הינה השיטה המקורית והמוכחת להכשרת עובדי הייטק.', 'Ze\'ev Jabotinsky 1 Ramat Gan, Tel Aviv District Israel', 'דרך זאב ז\'בוטינסקי 1, רמת גן', '03-5176663', '', '', '1', 14, 0, 'Computer Software', 'Educational', '2014'),
(8, '2016-06-24 13:57:08', '2016-06-24 13:57:08', 'Inneractive', 63, '', 'http://inner-active.com/', '51-200', 'Inneractive is an independent automated mobile ad marketplace focused on powering native and video ads. The company\'s mission is to empower mobile publishers to maximize the full potential of their properties by providing powerful technologies for buying and selling mobile ads. The Inneractive programmatic platform is comprised of a mobile Supply Side Platform (SSP), a Private Marketplace and an Open Ad Exchange that combine RTB with native and video ad solutions. Inneractive is headquartered in Tel Aviv with offices in San Francisco, New York and London.', '', '17 HAMEFALSIM ST. PETACH TIKVA 4951447, P. O. BOX 3102', '', '+972 73 7073800', '', '', '1', 19, 0, 'Marketing and Advertising', 'Privately Held', '2007'),
(9, '2016-06-24 14:28:26', '2016-06-24 14:28:26', 'Imonomy', 34, '', 'http://imonomy.com/', '51-200', 'imonomy offers an innovative in-image advertising solution that helps publishers to monetize their web & mobile sites and generate an incremental revenue stream. Our product displays dynamic and relevant ads on the most engaging parts of any site, the images.\r\n\r\nFounded in 2012, imonomy has developed a sophisticated algorithm that guarantees relevant ads by leveraging contextual semantic analysis, Big Data analytics, and consumer behaviors. Further, the company has designed cutting edge technology that transforms the way ads are displayed, helping publishers to maximize their sites’ monetization potential . \r\n\r\nPublishers that use imonomy successfully fulfill the demands  of both their users and advertisers. Users enjoy a much better ad experience on sites, while advertisers benefit from higher viewability and increased engagement rates, leading to higher CTRs.   \r\n\r\nimonomy is active worldwide and has helped over 13,000 publishers to monetize their sites. There are over 20 billion impressions on over 800 million images monetized by imonomy.', '', 'HaUmanim 10 Tel Aviv, Israel', '', '', '', '', '1', 22, 0, 'Internet', 'Privately Held', '2012'),
(10, '2016-06-24 16:25:50', '2016-06-24 16:25:50', 'Toyga', 34, '', 'http://www.toyga.co.il', '201-500', 'Founded in 2008, TOYGA is a world renowned CFD trading firm (currencies, stocks, commodities, and indices), and is one of the leading online trading companies in the world, primarily due to its commitment to technological innovation.\r\nTOYGA works with an international clientele, located in various countries worldwide. The company employs over 450 Israeli employees across 2 local branches, with head offices located in Tel-Aviv, and a second branch located in the northern city of Haifa.\r\nAt TOYGA\'s core is its technology division, Hexagon, and is one of the largest trading software developers in the financial industry. Overall, TOYGA has over 12 different departments, with diverse roles and opportunities for advancement.\r\nThe company provides fully funded training programs for new employees, custom tailored for each position. Additionally, we offer employee development and managerial training programs. \r\nOver the years, TOYGA has grown to become a leader in the financial industry, turning great ideas into even greater products, services, and customer experiences.', '', 'Tel-Aviv Tel aviv, Israel', '', '', '', '', '1', 32, 0, 'Financial Services', 'Privately Held', '2008'),
(14, '2016-08-10 17:31:48', '2016-08-10 17:31:48', 'Fiverr', 34, '', 'http://fiverr.com', '500', 'Fiverr® is shaping the future of work, every day, by shifting the freelance economy online. Founded in 2010, with offices in New York City, Chicago, Miami, San Francisco and Tel Aviv, Fiverr is the world’s most transacted marketplace for digital services. \r\n\r\nOur horizontal marketplace provides nearly any digital service in just one click, without haggling over the service deliverables or the price. Buyers can choose from the world’s largest catalog of pre-packaged services ranging from graphic design to music/video editing to marketing and copywriting. Fiverr sellers looking to make extra cash have delivered millions of high-quality Gigs® from 150+ categories of services, and across 196 countries.', '', '401 Broadway New York, NY 10013 United States', '', '', '', '', '1', 1, 0, 'Internet', 'Privately Held', '2010'),
(15, '2016-08-10 17:39:24', '2016-08-10 17:39:24', 'Panaya', 24, '', 'http://www.panaya.com', '200', 'Panaya CloudQuality™ Suite disrupts the risk, time and costs required to deliver all types of SAP® and Oracle® EBS changes. We are passionate about the need to make your ERP more agile and align it with your business. Powered by big data analytics and aggregating since 2008, Panaya CloudQuality™ Suite delivers insights that tell you what will break, how to fix it and what to test. It is constantly improving and finding smarter ways to perform everything from day-to-day maintenance to major projects. 1,220 companies in 62 countries, including a third of the Fortune 500, use the Panaya CloudQuality™ Suite to enhance and maintain their enterprise apps without skipping a beat.\r\n\r\nSAP, Oracle EBS, S4HANA, ERP Upgrades, SAP Upgrades, Oracle Upgrades, UAT', '', '6 HaHarash Hod Hasharon, Israel', '', '', '', '', '1', 15, 0, 'Computer Software', 'Privately Held', '2006'),
(16, '2016-08-10 18:21:09', '2016-08-10 18:21:09', 'Fundbox', 34, '', 'http://fundbox.com', '200', 'Fundbox offers business owners a simple way to fix their cash flow by advancing payments for their outstanding invoices. Tens of thousands of businesses have connected to the Fundbox platform to eliminate cash flow gaps by instantly clearing invoices. Fundbox is advancing thousands of invoices weekly, offering small business owners the ability to optimize their cash flow by advancing payments for unpaid invoices. This effectively eliminates the net 30, 60, 90-day problem from which so many small businesses suffer.', '', '', '', '', '', '', '1', 0, 0, 'Information Technology and Services', 'Privately Held', '2012'),
(17, '2016-08-10 18:31:23', '2016-08-10 18:31:23', 'Leverate', 15, '', 'http://www.leverate.com', '200', 'Started in 2008 by a core team of software development experts, Leverate is the leading technology solutions provider in the Forex industry. The company focuses on developing innovative products meant to simplify running a Forex business, and takes client support to the next level, with dedicated account managers and customer support available 24 hours a day.\r\n\r\n Leverate has perfected the concept of a “brokerage in a box” with the release of LXSuite, containing all of the platforms and software needed to successfully manage a Forex brokerage, including an award-winning social trading platform, a robust risk management platform, the most accurate price feed on the market, a CRM platform created exclusively for brokers, all linked to a diverse and regulated liquidity pool of top tier suppliers.\r\n\r\n At the heart of the LXSuite solutions package lies Sirix, our flagship HTML5 social trading platform. Sirix features an intuitive user interface designed to make trading easy, and is built to shine in multiple trading environments. The platform is fully branded and comes with several advanced charting and analytics tools. Brokers running Sirix can give clients access to a huge social trading community, conceived to encourage and educate traders.', '', 'Dereh Sheshet Haymim 30 Bnei Brak', '', '', '', '', '1', 1, 0, 'Financial Services', 'Privately Held', '2008'),
(19, '2016-08-11 22:36:32', '2016-08-11 22:36:32', 'Netboost Media', 66, '', 'http://www.netboostmedia.com', '200', 'Netboost Media is a vibrant, dynamic, creative online marketing company based in the Burse district of Ramat-Gan. Netboost Media, Est. 2006, specializes in creating and executing global marketing campaigns to a wide range of clients mainly in the UK. \r\nOperating within the outer boundaries of online marketing, applying imaginative tools and techniques in the fields of PPC, SEO, Web-Design, Coding, CRM, site management and more, Netboost Media succeeds in maintaining a considerable fore over most natural competitors. \r\nNetboost Medias personnel is a unique combination of enthusiast, devoted individuals focused on progressing the company to excel and at the same time fulfilling individual aspiration within the field of online marketing. In the last years Netboost Media had increased the number of its employees and continuing to do so. \r\nWith almost 60 of personnel, Netboost Media is currently looking for the next enthusiast individual to join an over 9 years of proven success!', '', '5 Hachilazon St. (8th floor) Ramat Gan, Israel', '', '', '', '', '1', 11, 0, 'Internet', 'Self Owned', '2006'),
(20, '2016-08-12 01:09:06', '2016-08-12 01:09:06', 'Pery', 64, '', 'http://pery.co.il/', '', 'Pery Rent a Car has been in operation here in Israel since 1975. We specialize in Car Rentals, Leasing, Sales, and Trade in. We cater to major corporate clients, as well as private clients.', '', 'Hasadna Street 8 Raanana', '', '', '', '', '1', 8, 0, 'Car Rental', 'Privately Held', '1975'),
(22, '2016-08-13 12:06:26', '2016-08-13 12:06:26', 'Taboola', 34, '', 'http://www.taboola.com', '500', 'Taboola is the leading discovery platform, serving 300 billion recommendations to over 750 million unique visitors every month on some of the Web’s most innovative publisher sites, including USA TODAY, Business Insider, Chicago Tribune, and The Weather Channel. Headquartered in New York City with R&D in Israel, Taboola also has offices in Pasadena, London, and Bangkok. Publishers, marketers, and agencies leverage Taboola to retain users on their sites, monetize their traffic, and distribute their content to drive high-quality audiences. Learn more at www.taboola.com and follow @taboola on Twitter and Instagram.', '', '7 Totseret Ha\'aretz St., 5th fl., Tel Aviv 6789104', '', '03-696-6966', '03-696-6961', '', '1', 0, 0, 'Internet', 'Privately Held', '2007'),
(23, '2016-08-13 12:13:08', '2016-08-13 12:13:08', 'Outbrain', 58, '', 'http://www.outbrain.com', '500', 'Outbrain is the world’s largest content discovery platform, bringing personalised, relevant online, mobile and video content to audiences while helping publishers understand their audiences through data. Outbrain serves over 190 billion personalised content recommendations every month and reaches over 561 million unique visitors from across the globe. \r\n\r\nOutbrain\'s expansion to some of the web\'s largest global properties is a reflection of its rapid growth and its successful innovations in supporting a new era of digital publishing. Top-tier premium publications that currently leverage the Outbrain platform include: CNN, ESPN, Le Monde, Fox News, The Guardian, Slate, The Telegraph, New York Post, Times of India and Sky News. \r\n\r\nFounded in 2006, the company is headquartered in New York with a presence in a growing number of locations globally, including the U.S., U.K., Israel, Singapore, Japan and Australia.', '', 'Arieh Regev Street 6\r\nNetanya, Israel', '', '073-2238900', '', 'info@outbrain.com', '1', 0, 0, 'Internet', 'Privately Held', '2006'),
(24, '2016-08-13 12:19:22', '2016-08-13 13:39:32', 'Gigya', 34, '', 'http://www.gigya.com/', '500', 'Gigya\'s Customer Identity Management platform helps companies build better customer relationships by turning unknown site visitors into known, loyal and engaged customers. With Gigya\'s technology, businesses increase registrations and identify customers across devices, consolidate data into rich customer profiles and provide better services, products and experiences by integrating data into marketing and service applications.\r\n\r\nGigya\'s platform, which includes products such as Registration-as-a-Service (RaaS)​, Social Login and Profile Management, was designed from the ground up for social identities, mobile devices, consumer privacy and modern marketing. Gigya provides developers with the APIs they need to easily build and maintain secure and scalable registration, authentication, profile management, data analytics and third-party integrations.\r\n\r\nMore than 700 of the world\'s leading businesses such as Fox, Forbes and ASOS rely on Gigya to build identity-driven relationships and to provide scalable, secure customer identity and access management. Headquartered in Mountain View, CA, Gigya is privately held and has raised more than $100m in capital from several leading venture capital firms including Benchmark Capital, Mayfield, Intel Capital, Adobe Ventures and Stanford University.', '', '132 Begin Road\r\nAzrieli Towers (Triangle), 43rd Floor\r\nTel Aviv, Israel 67021', '', '073 785 2400', '', '', '1', 3, 0, 'Computer Software', 'Privately Held', '2006'),
(25, '2016-08-14 14:59:38', '2016-08-14 14:59:38', 'CyberInt', 63, '', 'http://www.cyberint.com/', '50', 'By looking beyond the perimeter and providing constant vigilance of cyber activities, CyberInt eliminates potential threats before they become crises. Our expertise in cyber intelligence and protection of online activities defends companies of all sizes and industries. Our personalized services arm your company with the tools to protect itself from targeted threats.\r\n\r\nWe look at your business from an attacker’s perspective. We think like hackers and understand how they behave. Enabling a comprehensive understanding of what needs to be monitored and safeguarded, setting us up to provide safety beyond the perimeter. \r\n\r\nA recognized leader in cybersecurity solutions for many years, CyberInt’s customers include a variety of Fortune 500 companies across a variety of industry sectors.', '', 'Ha-Mefalsim Street 17, Petah Tikva, Israel', '', '+972-3-728-6777', '', '', '1', 3, 0, 'Computer & Network Security', 'Privately Held', '2009'),
(26, '2016-08-14 15:21:17', '2016-08-14 15:24:41', 'InifinityAR', 63, '', 'http://www.infinityar.com', '10', 'InfinityAR’s technology can turn any device into a powerful content augmentation platform.\r\n\r\nMission\r\nInfinityAR is all about digitally enhancing every person’s physical world.\r\n\r\nDescription\r\nWith our lives becoming more and more digital every day, there is an increasing need to bridge between our physical and digital worlds, letting us interact seamlessly with both worlds at the same time. Infinity AR’s vision is about creating a new digital environment that will allow people to naturally interact with augmented content in their physical surroundings.', '', '7 Mota Gur Street\r\nBuilding C, 4th floor\r\nP.O. Box 3146\r\nPetach Tikva, Israel, 4952801', '', '(+972)72-228-8390', '', 'info@infinityar.com', '1', 5, 0, 'Computer Software', 'Public Company', '2006'),
(27, '2016-08-14 23:12:17', '2016-08-14 23:12:17', 'VideoJam.tv', 66, '', 'http://www.videojam.tv', '50', 'VideoJam.tv is a video technology company with the mission and vision of unlocking programmatic video.\r\n\r\nWhile video content streaming, mobile usage and programmatic trade are growing at unprecedented rates, current ad serving and user experience are greatly behind and things just don\'t make much sense for end users and marketers.\r\n\r\nWe greatly believe that the future belongs to powerful, automated, predictive, big-data and AI driven programmatic trade we are building an engine to take us there and smart publisher and advertiser facing extensions on top of that engine. Advertisers and publishers alike are desperate for video ad serving solution that will do the right job, at the right price, in the right way, and that\'s what we are working on.', '', '24 HaYetzira Street,\r\nRamat Gan, 5252164', '', '+972-3-5665172', '', 'info@videojam.tv', '1', 4, 0, 'Marketing and Advertising', 'Privately Held', '2015'),
(28, '2016-08-14 23:30:06', '2016-08-14 23:30:06', 'ACS', 15, '', 'http://www.ACS.co.il', '150', 'ACS supports the full lifecycle of corporate information systems with a unique combination of products and services.  Our solutions help companies develop applications on-time and on-budget, while ensuring top performance and availability for their production systems.  ACS serves over 350 customers, including many of Israel’s leading companies, across all industry verticals\r\n\r\nPrivately held, ACS was founded in 1996 by CEO Avner Beshari and today employs over one hundred people.', '', '21 Bar Kochva AFI Concord Towers Bnei Brak, 5126016 Israel', '', '03-920-5000', '03-920-5001', '', '1', 6, 0, 'Computer Software', 'Partnership', '1996'),
(29, '2016-08-15 13:00:15', '2016-08-15 13:00:15', 'Covertix', 38, '', 'http://www.covertix.com', '50', 'Covertix offers complete protection of files shared with internal / external parties without affecting business continuity or user behavior. With Covertix\'s SmartCipher Solutions, organizations can control, monitor and protect data in motion or at rest, anywhere it resides\r\n\r\nSmartCipher Solution Platform: \r\n\r\n* Seamlessly adapts to business needs\r\n* Complete control of any type of file inside or outside the organization\r\n* Transparent integration into existing business driven processes\r\n* Zero interference to use behavior\r\n* Provides complete visibility\r\n* Simple comprehensive integration \r\n\r\nThe company is privately held and backed by investors.', '', '2 HaNagar Street P.O.Box 7109,\r\nKfar Saba 4442532\r\nIsrael', '', '+972.9.765.7726', '', 'info@covertix.com', '1', 4, 0, 'Computer & Network Security', 'Privately Held', '2000'),
(30, '2016-08-18 15:15:30', '2016-08-18 15:15:30', 'Dapulse', 34, '', 'https://www.dapulse.com', '50', 'dapulse is a web-based project management and team collaboration tool. It brings together all of your teams communications and keeps everyone engaged and focused on what matters.\r\n\r\nManage teams, companies, tasks and goals with a beautiful visual interface. We\'re on a mission to make people\'s work simpler, more productive and enjoyable.', '', '48 Yehuda Halevi st. 10 Floor Tel Aviv, Israel 63506 Israel', '', '', '', '', '1', 2, 0, 'Computer Software', 'Privately Held', '2012');
